    "2016-03-17T20:51:56.168827",nt"name": "iowa-physical-and-cultural-geographic-features",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains is a list of Iowa
    features contained in the Geographic Names Information System (GNIS).  The GNIS
    is the Federal standard for geographic nomenclature. The U.S. Geological Survey
    developed the GNIS for the U.S. Board on Geographic Names, a Federal inter-agency
    body chartered by public law to maintain uniform feature name usage throughout the
    Government and to promulgate standard names to the public. The GNIS is the official
    repository of domestic geographic names data; the official vehicle for geographic
    names use by all departments of the Federal Government; and the source for applying
    geographic names to Federal electronic and printed products of all types. See http://geonames.usgs.gov
    for additional information.  The Geographic Names Information System contains information
    about physical and cultural geographic features of all types, current and historical,
    but not including roads and highways. The database assigns a unique, permanent feature
    identifier, the Feature ID, as a standard Federal key for accessing, integrating,
    or reconciling feature data from multiple data sets. The GNIS collects data from
    a broad program of partnerships with Federal, State, and local government agencies
    and other authorized contributors.",nt"license_title": "License Not Specified",nt"extras":
